import React, { useState } from 'react';
import Grid from '@material-ui/core/Grid';
import FnsUtils from '@date-io/date-fns';
import {
    MuiPickersUtilsProvider,
    KeyboardDatePicker,
    KeyboardTimePicker,
} from '@material-ui/pickers';

export default function DatePickerExample() {
    const [selectedDate, setSelectedDate] = useState(new Date());

    function handleDateChange(date) {
        setSelectedDate(date);
    }

    return (
        <MuiPickersUtilsProvider
            utils={FnsUtils} 
        >
            <Grid 
                container 
            >
                <KeyboardDatePicker 
                    variant='inline' 
                    margin='normal' 
                    format='MM/dd/yyyy'
                    value={selectedDate} 
                    onChange={handleDateChange} 
                    label='Birthday' 
                    KeyboardButtonProps={{
                        'aria-label': 'change date',
                    }}
                />
                <KeyboardDatePicker 
                    margin='normal'
                    label='Birthday'
                    format='MM/dd/yyyy' 
                    value={selectedDate}
                    onChange={handleDateChange}
                    KeyboardButtonProps={{
                        'aria-label': 'change date',
                    }}
                />
                <KeyboardTimePicker 
                    margin='normal'
                    label='Select Time'
                    value={selectedDate}
                    onChange={handleDateChange} 
                    KeyboardButtonProps={{
                        'aria-label': 'change time',
                    }}
                />
            </Grid>
        </MuiPickersUtilsProvider>
    );
}
